const Scroll = (props) => {
    return (
        <div style={{overflowY: 'scroll' }}>
            {props.children}
            <div className='bt b--near-white'></div>
            <h1 className='f1 mh5 mv5 white'>AI HELPERS</h1>
        </div>
    );
};

export default Scroll;
